            candidateGovernor[_regNo] = newCandidate;
            governorList.push(_regNo);
            numberOfGovernor[5]++;

            // emit NewGovernorRegistered(_firstName, _collegeName, _programName, _yearOfStudy, _regNo, _blockNumber, _gender);
